import React from 'react';
import classes from './Home.module.css'
import BlockHead from "./BlockHead/BlockHead";
import Block2 from "./Block2/Block2";
import Block3 from './Block3/Block3';
import Block4 from "./Block4/Block4";
import Block5 from "./Block5/Block5";
import Block6 from "./Block6Portfolio/Block6";
import Block11 from "./Block11/Block11";
import Gallery from "./BlockGalleryWorked/Gallery";
import GalleryBlue from "./BlockGalleryBlue/Gallery";
import BlockRanking from "./BlockRanking/BlockRanking";
import BlockComments from "./BlockComments/BlockComments";

const  Home = (props) =>{
//console.log(props);
   let blocks = props.arrHead.map(d=> <BlockHead key={d.id} text1={d.text1} text2={d.text2} textBold={d.textBold} img={d.img}/>);
    let element2 = props.homeBlock2.map(d=> <Block2 key={d.id} h1={d.h1} h2={d.h2} link={d.link} span={d.text}/>);
    let element3 = props.homeBlock3.map(d=><Block3 key={d.id} title={d.title} text={d.text}/>);

      return (

        <div className={classes.blockWidth}>
            {blocks}
            <div className={classes.blockItem}>
                {element2}
            </div>
            <div className= {`${classes.blockItem} ${classes.blockItem2}`}>
                {element3}
            </div>
            <div className={classes.blockWidth}>
               <Block4 key={"4"} homeBlock4={props.homeBlock4} />
            </div>
            <div className={classes.blockGrey}>
                <Gallery key={'5'}  homeGallery = {props.homeGallery}/>
            </div>
            <div className={classes.blockWidth}>
                <Block6 key={'6'} homeBlock6={props.homeBlock6}/>
            </div>
            <div className={classes.blockBlue}>
                <GalleryBlue key={'6'} galleryBlue = {props.homeGalleryBlue}/>
            </div>
            <div className={classes.blockWidth}>
                <BlockRanking key={'7'} homeRanking = {props.homeRanking}/>
            </div>
            <div className={classes.blockBlue}>
                <BlockComments key={'8'} blockComments={props.blockComments} />
            </div>


            <div className={classes.blockGrey}>
                <Block5 key={'9'} homeBlock5={props.homeBlock5}/>
            </div>
            <div className={classes.blockWidth}>
                <Block11 key={'10'} blockFeatures={props.homeBlock11}/>
            </div>

        </div>

    );
};


export default Home;
